  [],\n\t\"revision_timestamp\": \"2015-11-25T17:40:16.282802\",\n\t\"name\": \"tcte-level-3-total-solar-irradiance-daily-means-v002\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Total Solar Irradiance (TSI) Calibration
  Transfer Experiment (TCTE) data set TCTE3TSID contains daily averaged total solar
  irradiance (a.k.a solar constant) data collected by the Total Irradiance Monitor
  (TIM) instrument covering the full wavelength spectrum. The data are normalized
  to one astronomical unit (1 AU).nnThe TCTE/TIM instrument measures the Total Solar
  Irradiance (TSI), monitoring changes in incident sunlight to the Earth's atmosphere
  using an ambient temperature active cavity radiometer to a designed absolute accuracy
  of 350 parts per million (ppm, 1 ppm=0.0001% at 1-sigma), and a precision and long-term
  relative accuracy of 10 ppm per year. Due to the small size of these data and to
  maximize ease of use to end-users, each delivered TSI product contains science results
  for the entire mission in an ASCII column formatted file.nnEarly in the mission,
  between Dec 2013 and May 2014, TCTE acquired daily measurements to establish good
  overlap with the SORCE TIM. From May 2014 to Dec 2014, the TCTE measurements were
  reduced to weekly, which greatly subsample the true solar variability, and thus
  have little value for solar research. Beginning in Jan 2015, daily obervations were
  resumed.nnRelease Notes:n2015-04-21: Version 2 applies dark and degradation corrections
  to the data.nn2015-01-20: Version 1 is the first public release of TCTE TIM data.
  The Version 1 estimated absolute accuracies are 0.1% (1000 ppm) and will be improved
  in future versions as additional corrections are applied.\",\n\t\"license_title\":
